import React from 'react';
import { AppBar, Toolbar, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <AppBar position="static">
      <Toolbar>
        {/* Box to center the buttons */}
        <Box sx={{
          display: 'flex',
          justifyContent: 'center', // Center the buttons horizontally
          width: '100%' // Ensure the Box takes up full width
        }}>
          <Button color="inherit" component={Link} to="/" sx={{ mx: 2 }}>Home</Button>
          <Button color="inherit" component={Link} to="/about" sx={{ mx: 2 }}>About</Button>
          <Button color="inherit" component={Link} to="/projects" sx={{ mx: 2 }}>Projects</Button>
          <Button color="inherit" component={Link} to="/contact" sx={{ mx: 2 }}>Contact</Button>
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
